import './index.css';
import NikeLogo from '../../../assets/nike.svg';

const MainMenu = () => {
    return (
        <div className="MainMenu">
            <div className="Swoosh"><img src={NikeLogo} alt="Nike Logo" /></div>
            <nav>
                <ul>
                    <li>Men</li>
                    <li>Women</li>
                    <li>Kids</li>
                    <li>Sales</li>
                    <li>Collections</li>
                </ul>
            </nav>
            <div>
                <ul>
                    <li>Searchbar</li>
                    <li>Favorites</li>
                    <li>Basket</li>
                </ul>
            </div>
        </div>
    );
}

export default MainMenu;
